// src/pages/AdminDashboard.js
import React, { useState, useEffect } from "react";
import {
  Box,
  Typography,
  Tabs,
  Tab,
  TextField,
  Button,
  Stack,
  CircularProgress,
  IconButton,
} from "@mui/material";
import { Delete as DeleteIcon } from "@mui/icons-material";
import axios from "axios";

const AdminDashboard = () => {
  const [tab, setTab] = useState(0);
  const [loading, setLoading] = useState(false);
  const [adminData, setAdminData] = useState({});
  const [announcements, setAnnouncements] = useState([]);
  const [rulebooks, setRulebooks] = useState({});
  const [registrationLink, setRegistrationLink] = useState("");
  const [socialLinks, setSocialLinks] = useState({});
  const [contact, setContact] = useState({
    main: { name: "", title: "", number: "" },
    coordinators: [],
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    setLoading(true);
    try {
      const res = await axios.get("http://localhost:5000/api/admin");
      const data = res.data || {};
      setAdminData(data);
      setAnnouncements(data.announcements || []);
      setRulebooks(data.rulebooks || {});
      setRegistrationLink(data.registration?.googleFormLink || "");
      setSocialLinks(data.socialLinks || {});
      setContact(
        data.contact || { main: { name: "", title: "", number: "" }, coordinators: [] }
      );
    } catch (err) {
      console.error("Fetch error:", err);
    } finally {
      setLoading(false);
    }
  };

  const saveContact = async () => {
    setLoading(true);
    try {
      await axios.put("http://localhost:5000/api/admin/contact", { contact });
      alert("✅ Contact info updated!");
    } catch (err) {
      console.error(err);
      alert("Failed to save contact info.");
    } finally {
      setLoading(false);
    }
  };

  // Other save functions (announcements, rulebooks, etc.) remain unchanged...

  return (
    <Box sx={{ p: 4 }}>
      <Typography
        variant="h4"
        sx={{ mb: 3, fontWeight: "bold", color: "#d32f2f" }}
      >
        Admin Dashboard
      </Typography>

      <Tabs value={tab} onChange={(e, val) => setTab(val)}>
        <Tab label="Announcements" />
        <Tab label="Rulebooks" />
        <Tab label="Registration" />
        <Tab label="Social Links" />
        <Tab label="Contact Info" />
      </Tabs>

      {loading && <CircularProgress sx={{ mt: 3 }} />}

      {/* Other tabs remain same ... */}

      {/* Contact Info */}
      {tab === 4 && (
        <Stack spacing={3} sx={{ mt: 3 }}>
          <Typography variant="h6" sx={{ fontWeight: "bold" }}>
            Main Contact
          </Typography>
          <Stack direction="row" spacing={2}>
            <TextField
              label="Name"
              fullWidth
              value={contact.main?.name || ""}
              onChange={(e) =>
                setContact({
                  ...contact,
                  main: { ...contact.main, name: e.target.value },
                })
              }
            />
            <TextField
              label="Title"
              fullWidth
              value={contact.main?.title || ""}
              onChange={(e) =>
                setContact({
                  ...contact,
                  main: { ...contact.main, title: e.target.value },
                })
              }
            />
            <TextField
              label="Number"
              fullWidth
              value={contact.main?.number || ""}
              onChange={(e) =>
                setContact({
                  ...contact,
                  main: { ...contact.main, number: e.target.value },
                })
              }
            />
          </Stack>

          <Button
            variant="contained"
            color="primary"
            onClick={saveContact}
            sx={{ width: "200px" }}
          >
            Save Main Contact
          </Button>

          <Typography variant="h6" sx={{ fontWeight: "bold", mt: 3 }}>
            Coordinators
          </Typography>

          {contact.coordinators?.map((coord, i) => (
            <Stack direction="row" spacing={2} key={i} alignItems="center">
              <TextField
                label="Name"
                fullWidth
                value={coord.name}
                onChange={(e) => {
                  const newList = [...contact.coordinators];
                  newList[i].name = e.target.value;
                  setContact({ ...contact, coordinators: newList });
                }}
              />
              <TextField
                label="Title"
                fullWidth
                value={coord.title}
                onChange={(e) => {
                  const newList = [...contact.coordinators];
                  newList[i].title = e.target.value;
                  setContact({ ...contact, coordinators: newList });
                }}
              />
              <TextField
                label="Number"
                fullWidth
                value={coord.number}
                onChange={(e) => {
                  const newList = [...contact.coordinators];
                  newList[i].number = e.target.value;
                  setContact({ ...contact, coordinators: newList });
                }}
              />
              <IconButton
                color="error"
                onClick={() => {
                  const newList = contact.coordinators.filter((_, idx) => idx !== i);
                  setContact({ ...contact, coordinators: newList });
                }}
              >
                <DeleteIcon />
              </IconButton>
            </Stack>
          ))}

          <Stack direction="row" spacing={2}>
            <Button
              variant="outlined"
              onClick={() =>
                setContact({
                  ...contact,
                  coordinators: [
                    ...contact.coordinators,
                    { name: "", title: "", number: "" },
                  ],
                })
              }
            >
              + Add Coordinator
            </Button>
            <Button
              variant="contained"
              color="success"
              onClick={saveContact}
            >
              Save All Contacts
            </Button>
          </Stack>
        </Stack>
      )}
    </Box>
  );
};

export default AdminDashboard;
